import classes from "./SearchList.module.css";
const SearchList = () => {
  const Dummy_Search = [
    {
      name: "Tower Street Apartments",
      distance: "500m",
      tag: "Free airport taxi",
      type: "Entire studio • 1 bathroom • 21m² 1 full bed",
      description: "Studio Apartment with Air conditioning",
      free_cancel: true,
      price: 112,
      rate: 8.9,
      rate_text: "Excellent",
      image_url: "./images/hotel_search_1.webp",
    },
    // {
    //   name: "Comfort Suites Airport",
    //   distance: "200m",
    //   tag: "Free Breakfast",
    //   type: "Entire studio • 2 bathroom • 100m² 2 full bed",
    //   description: "Studio Apartment",
    //   free_cancel: true,
    //   price: 140,
    //   rate: 9.3,
    //   rate_text: "Exceptional",
    //   image_url: "./images/hotel_search_2.jpg",
    // },
    // {
    //   name: "Four Seasons Hotel",
    //   distance: "100m",
    //   tag: "Free Parking",
    //   type: "1 bathroom • 51m² 2 full bed",
    //   description: "Hotel in Lisbon",
    //   free_cancel: false,
    //   price: 99,
    //   rate: 8.8,
    //   rate_text: "Excellent",
    //   image_url: "./images/hotel_search_3.jpg",
    // },
  ];

  return (
    <div className={classes.list}>
      {Dummy_Search.map((data) => (
        <div>
          <div>
            <img src={data.image_url}></img>
          </div>
          <div className={classes.content}>
            <div className={classes.name}>
              <h2>{data.name}</h2>
              <b></b>
              <p>{data.rate_text}</p>
              <p>{data.rate}</p>
            </div>
            <div>
              <p>{data.distance} from center</p>
              <p>{data.tag}</p>
              <p>{data.description}</p>
              <p>{data.type}</p>
            </div>
            <div>
              <div>
                {data.free_cancel === true
                  ? `${(<p>Free cancellation</p>)} ${(
                      <p>
                        You cancel later, so lock in this great price to day
                      </p>
                    )}`
                  : ""}
              </div>
              <div className={classes.btn__save}>
                <p>{data.price}</p>
                <p>Incluide texas and fees</p>
                <button>Save availability</button>
              </div>
            </div>
          </div>
        </div>
      ))}
    </div>
  );
};
export default SearchList;
